const url = "http://localhost:8080";

export const postSignIn = async (data) => {
    const response = await fetch(`${url}/login`, {
        method:"POST",
        body: JSON.stringify(data),
        headers: {
            "Content-Type": "application/json"
        }
    });
    const responseData = await response.json();

    return responseData;
}
